        ["Description"] = "Venids are commonly spotted soaring in groups across the Wasteland skies. These wasp-winged dragons are known for their capability to reach immaculate flight speeds! If you observe flying races, you will likely see a nearby competitor riding the back of this formidable companion. Despite having a powerful dragon’s breath, they mainly defend themselves with their stinger-like tails if provoked. These tails contain a potent toxin that takes a strenuous effort to heal. It is best not to disrupt these dragons in the wild, as their temper flares up quickly. They are often seen in medium-sized groups hunting prey and gathering food for their nest. Nevertheless, these dragons are still remarkable on their own, especially alongside a strong and loyal dragon tamer.",
