        ["Description"] = "The Venu is an unusual snake-like dragon known for its ability to withstand extreme temperatures. They enjoy bathing in pools of lava and have been observed burrowing underneath soft ashes, making the Volcano their habitat of choice. Their docile temperament, low agility, and lack of flight usually makes them poor fighters. Instead, they prefer to burrow and hide away from danger. The multiple spines across their body aid in their ability to carve out tunnels and burrows, whilst the two bumps found on their head detect levels of heat radiation, helping them locate streams of lava or other potential threats whilst digging. Although they are primarily carnivorous, they receive the little water they need from fruits.",
