        ["Description"] = "The Scrawei, a Halloween tradition given life, is often regarded as a symbol of bountiful harvest and joy. These incredibly elusive dragons are overwhelmingly optimistic by nature, often being playful and deeply loyal to their trainers. Derived from an ancient epic poem, these cheerful dragons are often described as being a handful, often getting into antics and causing troubling mischief. They may also be described as a little clumsy, showing quite a lack of self-awareness. Despite the trouble they may cause, the Scrawei's greatest strength is its sociability, as they're average in terms of speed, strength, and overall ability. These dragons make great companions, being incredibly protective, gentle, and playful overall.",
