        ["Description"] = "The Kostragula, a creature of ancient malevolence, reigns as a legendary dragon dwelling in the ominous depths of the Shadow Altar within the prehistoric world. This nefarious entity is the stuff of nightmares, boasting an anatomical aberration that defies conventional draconic design—a twisted, upside-down head that stares with dark, evil eyes, accompanied by a second head that serves as its ominous tail. Its presence is shrouded in darkness, evoking a sense of impending doom. The Kostragula possesses formidable strengths, with an imposing reservoir of great health, rendering it a monstrous force to be reckoned with. While its speed may not match some of its swifter counterparts, its relentless pursuit is still a formidable threat. What truly sets the Kostragula apart is its savage and powerful attack, capable of unleashing devastation upon anything unfortunate enough to cross its path. Legends speak of brave adventurers venturing into the Shadow Altar, but few have lived to share their harrowing encounters with this maleficent dragon.",
