        ["Stats"] = {["Speed"] = 58, ["Health"] = 2500, ["WalkSpeed"] = 58, ["Attack"] = 135},
        ["Description"] = "The Neroxide is a common drake species found in the harsh world of Wasteland. They are notorious for being stealthy, revered hunters in the dark gloomy world they call home. Their feet help them keep excellent grip on rocky terrain and are capable of allowing them to jump at extreme heights, in addition to their large, strong pincer-like arms that help keep them balanced and brace them for impact. One of the most recognizable traits of the Neroxide is its large head frills, which are shaken to intimidate any foes it may come across. The webbed spines on their tail are flexible and can be used to produce amplified rattling sounds, similar to their head frills. They have split jaws with sharp teeth, providing them with great attack power. However, Neroxides have poor health and defense but make up for this in fantastic ground speed and great leaping abilities. Taming a Neroxide can be difficult as they prefer to stay away from dragon adventurers and are rather territorial. If a dragon tamer is determined and persistent enough to gain the trust of a Neroxide, they should be prepared to take on the massive responsibility of owning one of these exotic beasts.",
