        ["Description"] = "The elusive and agile Tigrilias are the kings of the Grasslands, using their black stripes to blend into the thick foliage. Often found wandering the hilly landscape in solidarity or, very rarely, bonded pairs with cubs. Despite not being the strongest of dragons in terms of health and defense, this species uses its small size, speed, and agility to take down its prey, making it a very successful hunter. They earn their name from their striking resemblance to one of the most lethal predators known to mankind, the tiger. These dragons have sharp, pearly teeth, scarred muzzles, and sharp shoulder and horn spikes designed to intimidate even the most dangerous of foes. These beasts may be unable to fly, but their ability to dominate and control the terrain is unparalleled. If brave enough to try, Tigrilias are perfect companions if one fancies a loyal companion on a hunting trip or a merciless ally against the various foes across the world.",
