        ["Description"] = "Tarakas are large, majestic and mysterious dragons, native to the Ocean world. Although they are more common than some of the other dragons they share their home with, Tarakas are still relatively elusive. They usually live down in the deeper parts of the Ocean world, but they occasionally return to the surface to collect objects such as shells to collect in their dens. Researchers are not sure exactly why they do this, but they suspect it could be some sort of leisurely activity. Many sailors attempt to find Tarakas' stashes to keep for themselves but never return successful. Tarakas and Krekiz sometimes fight over territory and prey due to being the two apex predators of the Ocean world, but these fights never result in any injuries. The more dominant Tarakas, which have larger horns, tend to be more territorial. Tarakas are also viewed as legendary amongst sailors, and having one as a companion is very prestigious.",
