        ["Description"] = [[Pagulaus are small, tropical shore dwelling dragons that are solitary by nature. They're often described as very colorful, coming in a variety of bright colors. They're very skittish and try to run or to hide away from any disturbance, however if cornered they're not afraid to fight back using their pinchers and claws. It might be difficult for trainers to gain the trust of one at first, but they're known as wonderful companions if the trainer succeeds.
Pagulaus share an interesting relationship with a more aquatic subspecies of gaulyra, as they use the shell of fallen juveniles for protection. When molting they have to go looking for a new gaulyra shell, often falling prey to predators in the process. Usually Pagulaus only gain their bright appearance after their new shell has hardened.
