        ["Description"] = "The Viridik hides itself from humankind in the cold tundra and taigas, where they find peace and tranquillity. These season dragons are often seen around winter and feed on ferns, berries, and smaller animals. The Viridik’s feathered body keeps it insulated from the cold and its bare feet and tail help keep it cool in the humid summers. The Viridik’s large size and impressive head feathers make them intimidating to any potential predators, and they are often admired by many for their exalted behaviour and appearance. Due to their secretive nature, they try to avoid any would-be dragon tamers, making them difficult to spot. If a Viridik senses that a tamer is kind with good-hearted intentions however, they will take upon the role of becoming that tamer’s lifelong companion and dragon friend. Their elusiveness and passive-nature pay a price for their combat abilities, as they boast average stats that may only be effective on weaker dragons. Tamed Viridiks prefer to lounge in grassy meadows with their tamers and enjoy flying in clear skies, where they will often soar for hours.",
