        ["Stats"] = {["Health"] = 3000, ["Speed"] = 22, ["FlySpeed"] = 32, ["WalkSpeed"] = 22, ["Attack"] = 105},
        ["Description"] = "Slow-moving and sociable, Enkylouses can easily be found relaxing in groups of 2-3 almost everywhere across the ocean, looking for seaweed or small critters on the ocean's floor to feast upon. These docile dragons are easily recognized by their tough shells and powerful fins that they use to glide and navigate through the harsh currents of the deeper waters. Most dragons tend to avoid the Enkylous when it comes to picking opponents for battles as they can be quite difficult to take down, not only because of their shells, as their swift and powerful jaws are comparable to the formidable Krekiz. Despite having no teeth, they are still able to deliver quick bites with tons of force, making them less vulnerable in close-ranged battles. Though, even if they possess powerful melee capabilities, Enkylouses are not skilled fighters, with their preference to hide from danger rather than interact and flee due to their slow speed. Fortunately, their curious and docile nature makes them easier to domesticate; said traits make them wonderful companions for both dragons and adventurers who are looking for a friend.",
