        ["Description"] = "While rather elusive in nature, the Vulpiruth- a seasonal dragon commended for its swiftness- are known to be some of the most curious bunches of dragons throughout Dragonaria. It's not uncommon to spot these dragons exploring anything that catches their attention, whether that be a tortoise flipped on its shell, or a distant crash in the forest. Even so, these dragons are swift on their feet- they usually only appear as a flash of orange through the green foliage. Somehow, without wings, they will take flight during the night while the moonlight seeps through the trees. It is speculated that these dragons have a close connection to the moon, much like their distant cousins the Casirus. They may not be the best when it comes to a fighting companion, but they are quick and nimble footed which makes it easy to get out of scrapes when flying isn't an option. Taming one of these dragons can be a hassle, though rest assured their loyal and playful companionship makes them a lovely dragon to have around.",
