        ["Description"] = [[The Stellaris, a mystical and elusive dragon found in the darkest reaches of the world, embodies the very essence of the night sky. These dragons are adorned with a breathtaking array of pitch-black feathers, speckled with star-like spots that shimmer under moonlight, creating an ethereal, cosmic effect. The Stellaris are known for their elegant and majestic flight, gliding silently through the night with their expansive wings that reflect the mysteries of the universe.

Distinctive features of the Stellaris include a prominent beak horn, which adds to their regal and commanding presence. Their beak and shoulder regions are covered in a soft, dense fur that provides warmth and protection against the chill of the night. Their feet are equipped with sturdy scales, offering excellent grip and stability when perched on rocky ledges or ancient ruins. Adding to their otherworldly appearance are crescent-shaped spikes along their tail, glowing faintly like lunar crescents.

These dragons are not easily tamed, preferring solitude and the company of the stars. Their agility and speed make them formidable in the skies, although they are rarely seen engaging in combat. The Stellaris dragons possess a natural affinity for stealth and evasion, making them elusive and difficult to capture. Despite their reclusive nature, they are revered by those who have been fortunate enough to witness their splendor, often regarded as guardians of the night and keepers of ancient celestial secrets.

The Stellaris is a marvel of the dragon world, a living constellation that continues to inspire awe and wonder in all who behold its beauty.]],
