        ["Stats"] = {["Health"] = 2750, ["Speed"] = 56, ["FlySpeed"] = 40, ["WalkSpeed"] = 56, ["Attack"] = 125},
        ["Description"] = "The Fayrah is sharp-witted and fierce, holding great amounts of memories and wisdom from being reborn repeatedly through its own ashes over many generations. They are sequestered and observant dragons who will only befriend dragon tamers they see as worthy and capable of true love, especially during the month of February. Fayrahs are dedicated to protecting their owners at all costs. They have strong legs, wings, sharp beaks, and talons that provide decent speed and quick attacks to compensate for their poorer health and defense capabilities. They live in family-based groups, caring intensely for each other, and are highly territorial over their hatchlings. Due to the fact that each head controls one half of the body, they mature and learn more slowly than the average dragon. However, they become more graceful and agile as they age, growing keener over time.",
