        ["Description"] = "The Radidon is a large, carnivorous dragon that is a rare sight in its native world, Wasteland. These majestic beings have a wide range of temperaments, yet typically display a gentle and calm demeanour unless provoked. However, once aggravated, they can become fierce, unpredictable and hazardous. Radidons possess impressive physical strength, rendering them resilient in both offense and defense, rendering them difficult to strike down. Distinguishing themselves from others, Radidons lack eyesight, requiring alternative means for navigation and hunting. They rely on their ability to detect ground vibrations and possess a keen sense of smell, enabling them to easily track down their prey amidst the vast, open landscape of Wasteland. Earning the trust of a Radidon is a simple enough task due to their willingness to create allies. Once their trust is secured, these remarkable creatures serve as kind and devoted companions for life.",
