        ["Description"] = [[The Ignicaris is a strange and unique species of dragon, found in the oceans underneath the prehistoric island chain. It is theorized
that Ignicaris may have been the first true dragon to ever exist, with most species of dragons being distantly related to it. These oceanic dragonsspend equal time in and out of waterand primarily eat fish, crustaceans and birds. The toothed appendages on their face have a surprisingly powerful grip and are used to restrain their prey. Ignicaris prefer not to fight with other dragons, preferring to mind their own businuess they are more than capable of holding their own. Instead of fire, wild Ignicaris breath condensed jets of scalding hot water, with high levels of accuracy. Being sprayed by an Ignicaris is enough to make most dragons turn tail and flee.

Ignicaris are very easy to tame, and can easily be swayed to your side by the sight of a tasty fish. But they aren't particularly loyal and tend to have very neutral opinions on their tamers unless raised from an egg. They are also very rare to find, being one of the last remaining dragons from their time period.]],
